import React, { Component } from 'react';
import MyImage from '../photo/DSC_8641.jpg';

class CommentCard extends Component {

    render() { 
        return ( 
            <div className="mt-3">
                <img className="img-resize" src={MyImage} alt={this.props.name}/>
                <div>
                    <h5>{this.props.name} . {this.props.nickName}</h5> 
                    <p>comment</p>
                    <p className='like-reply'>Like </p><p>reply </p><h6 style={{display: "inline-block"}}>. time</h6>
                </div>
            </div>
         );
    }
}

export default CommentCard;
